import React from 'react';
import './Nav.scss';

 function Navbar() {
  return (
<nav>
  <div>
     GoodWorm Gardens
  </div>
  <ul>
    <li>Home</li>
    <li>Connect yards</li>
    <li>Gardening guide</li>
    <li>Coordinators</li>
    <li>Contact us</li>
    </ul>
</nav>
  )
}
export default Navbar;
